import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";



const App = () => {
  const Home = () => <h2>Home</h2>;
  const About = () => <h2>App</h2>;
  return (
    <Router>
      <Link to="/">Home</Link>
      <Link to="/about">About</Link>
    </Router>
  );
};


export default App;
